import React from 'react'
import {
  Inject,
  ScheduleComponent,
} from '@syncfusion/ej2-react-schedule';

const CalenderComponent = () => {
  return (
    <div className="calender">
      <ScheduleComponent height="360px" currentView="Week">
        <Inject />
      </ScheduleComponent>
    </div>
  )
}

export default CalenderComponent
